import React from 'react'
import Header from './components/Header'
import Footer from './components/Footer'
import Note from './components/Note'
import notes from './notes'

const app = () => {
   console.log(notes)
    return (
        <div>
        <Header />
        {notes.map(note => 
            <Note 
            key={note.key}
            title={note.title}
            content={note.content}    
            /> )}
        
         <Footer /> 
        </div>
    )
}

export default app
